CREATE DEFINER=`root`@`localhost` PROCEDURE `AddTrackToPlaylistByCreator`(
    IN p_playlist_id INT,
    IN p_track_id INT,
    IN p_creator_username VARCHAR(255))
BEGIN
    DECLARE playlist_exists INT;
    DECLARE track_exists INT;
    DECLARE track_in_playlist INT;
    DECLARE actual_creator_username VARCHAR(255);

    -- Check if the playlist exists
    SELECT COUNT(*) INTO playlist_exists FROM Playlist WHERE playlist_id = p_playlist_id;
    IF playlist_exists = 0 THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Playlist not found';
    END IF;

    -- Get the creator's username
    SELECT creator_username INTO actual_creator_username FROM Playlist WHERE playlist_id = p_playlist_id;
    IF p_creator_username != actual_creator_username THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Unauthorized: Only the playlist creator can add tracks';
    END IF;

    -- Check if the track exists
    SELECT COUNT(*) INTO track_exists FROM Track WHERE track_id = p_track_id;
    IF track_exists = 0 THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Track not found';
    END IF;

    -- Check if the track is already in the playlist
    SELECT COUNT(*) INTO track_in_playlist FROM PlaylistTracks WHERE playlist_id = p_playlist_id AND track_id = p_track_id;
    IF track_in_playlist > 0 THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Track already in playlist';
    END IF;

    -- Add the track to the playlist
    INSERT INTO PlaylistTracks (playlist_id, track_id) VALUES (p_playlist_id, p_track_id);
END ;;
DELIMITER ;
