CREATE DEFINER=`root`@`localhost` PROCEDURE `CalculateAndStoreRecommendations`(IN input_user VARCHAR(255))
BEGIN
    DECLARE finished INT DEFAULT 0;
    DECLARE track_id INT;
    DECLARE artist_name VARCHAR(255);
    DECLARE composite_score DECIMAL(10, 5);
    DECLARE user_weight DECIMAL(5, 2) DEFAULT 0.4;
    DECLARE track_weight DECIMAL(5, 2) DEFAULT 0.4;
    DECLARE artist_weight DECIMAL(5, 2) DEFAULT 0.2;
    DECLARE artist_score DECIMAL(5, 4);
    DECLARE user_score DECIMAL(5, 4);
    DECLARE track_score DECIMAL(5, 4);
    DECLARE recommendation_count INT DEFAULT 0;
    DECLARE cur_track CURSOR FOR
        SELECT T.track_id, AL.artist_name
        FROM Track T
        JOIN Album AL ON T.album_id = AL.album_id;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET finished = 1;

    OPEN cur_track;

    track_loop: LOOP
        FETCH cur_track INTO track_id, artist_name;
        IF finished THEN
            LEAVE track_loop;
        END IF;

        -- Calculate average user score from UserSimilarity table
        SELECT AVG(IFNULL(similarity_score, 0)) INTO user_score 
        FROM UserSimilarity 
        WHERE (username1 = input_user AND username2 = track_id) OR (username2 = input_user AND username1 = track_id);

        -- Calculate average track score from TrackSimilarity table
        SELECT AVG(IFNULL(similarity_score, 0)) INTO track_score 
        FROM TrackSimilarity 
        WHERE (track_id1 = track_id OR track_id2 = track_id);

        -- Calculate average artist score from ArtistSimilarity table
        SELECT AVG(IFNULL(similarity_score, 0)) INTO artist_score 
        FROM ArtistSimilarity 
        WHERE (artist_name1 = artist_name OR artist_name2 = artist_name);

        -- Compute composite score
        SET composite_score = user_weight * user_score + track_weight * track_score + artist_weight * artist_score;

        -- Insert or update recommendations in UserReceivesRecommendations table
        INSERT IGNORE INTO UserReceivesRecommendations (username, track_id, recommendation_date)
        VALUES (input_user, track_id, CURRENT_TIMESTAMP);

        -- Update recommendation count and check if limit is reached
        SET recommendation_count = recommendation_count + 1;
        IF recommendation_count >= 20 THEN
            LEAVE track_loop;
        END IF;
    END LOOP track_loop;

    CLOSE cur_track;
END ;;
DELIMITER ;
