CREATE DEFINER=`root`@`localhost` PROCEDURE `ComprehensiveSearch`(IN search_term VARCHAR(255))
BEGIN
    -- Top Results (limiting to a few results per category)
    -- Artists
    SELECT 'Artist' AS type, name AS result FROM Artist WHERE name LIKE CONCAT('%', search_term, '%') LIMIT 3;

    -- Albums
    SELECT 'Album' AS type, name AS result FROM Album WHERE name LIKE CONCAT('%', search_term, '%') LIMIT 3;

    -- Tracks
    SELECT 'Track' AS type, name AS result FROM Track WHERE name LIKE CONCAT('%', search_term, '%') LIMIT 3;

    -- Playlists
    SELECT 'Playlist' AS type, name AS result FROM Playlist WHERE name LIKE CONCAT('%', search_term, '%') LIMIT 3;

    -- Genres
    SELECT 'Genre' AS type, name AS result FROM Genre WHERE name LIKE CONCAT('%', search_term, '%') LIMIT 3;

    -- Users
    SELECT 'User' AS type, username AS result FROM User WHERE username LIKE CONCAT('%', search_term, '%') LIMIT 3;

    -- Detailed Results
    -- Artists
    SELECT * FROM Artist WHERE name LIKE CONCAT('%', search_term, '%');

    -- Albums
    SELECT * FROM Album WHERE name LIKE CONCAT('%', search_term, '%');

    -- Tracks
    SELECT * FROM Track WHERE name LIKE CONCAT('%', search_term, '%');

    -- Playlists
    SELECT * FROM Playlist WHERE name LIKE CONCAT('%', search_term, '%');

    -- Genres
    SELECT * FROM Genre WHERE name LIKE CONCAT('%', search_term, '%');

    -- Users
    SELECT username, email, date_of_birth FROM User WHERE username LIKE CONCAT('%', search_term, '%');
