CREATE DEFINER=`root`@`localhost` PROCEDURE `DeletePlaylist`(
    IN p_playlist_id INT,
    IN p_creator_username VARCHAR(255))
BEGIN
	DECLARE creator_username VARCHAR(255);
    DECLARE exists_flag INT;

    -- Check if the playlist exists and get the creator's username
    SELECT COUNT(*), creator_username INTO exists_flag, creator_username FROM Playlist WHERE playlist_id = p_playlist_id;

    -- If the playlist does not exist
    IF exists_flag = 0 THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Playlist not found';
    END IF;

    -- If the requestor is not the creator
    IF p_creator_username != creator_username THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Unauthorized access - Only the creator can delete the playlist';
    END IF;

    -- Delete the playlist
    DELETE FROM Playlist WHERE playlist_id = p_playlist_id;
END ;;
DELIMITER ;
