CREATE DEFINER=`root`@`localhost` PROCEDURE `GenerateAndUpdateRecommendations`()
BEGIN
    DECLARE finished INT DEFAULT 0;
    DECLARE user_id VARCHAR(255);
    DECLARE cur_user CURSOR FOR SELECT username FROM User;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET finished = 1;

    OPEN cur_user;

    user_loop: LOOP
        FETCH cur_user INTO user_id;
        IF finished THEN
            LEAVE user_loop;
        END IF;

        CALL CalculateAndStoreRecommendations(user_id);
    END LOOP user_loop;

    CLOSE cur_user;
END ;;
DELIMITER ;
