CREATE DEFINER=`root`@`localhost` PROCEDURE `GetUserRecommendations`(IN input_username VARCHAR(255))
BEGIN
    SELECT 
        URR.track_id, 
        T.name AS track_name, 
        T.file_path, 
        T.duration,
        AL.name AS album_name, 
        AL.artist_name
    FROM 
        UserReceivesRecommendations URR
    JOIN 
        Track T ON URR.track_id = T.track_id
    JOIN 
        Album AL ON T.album_id = AL.album_id
    WHERE 
        URR.username = input_username
    ORDER BY 
        URR.recommendation_date DESC
    LIMIT 20;
END ;;
