CREATE DEFINER=`root`@`localhost` PROCEDURE `ProcessPayment`(
    IN p_username VARCHAR(255), 
    IN p_payment_method ENUM('debit card', 'credit card', 'gift card'),
    IN p_amount DECIMAL(10, 2))
BEGIN
    DECLARE subscription_id INT;
    DECLARE plan_price DECIMAL(10, 2);
    DECLARE error_message VARCHAR(255);

    -- Get the latest inactive subscription to process payment for
    SELECT UserSubscription.subscription_id, Plan.price INTO subscription_id, plan_price
    FROM UserSubscription 
    JOIN Plan ON UserSubscription.plan_name = Plan.name
    WHERE UserSubscription.username = p_username AND UserSubscription.status = 'inactive'
    ORDER BY UserSubscription.subscription_id DESC
    LIMIT 1;

    IF subscription_id IS NULL THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'No inactive subscription found for payment';
    END IF;

    -- Diagnostic: Check if payment amount matches plan price
    IF p_amount != plan_price THEN
        SET error_message = CONCAT('Incorrect payment amount. Expected: ', CAST(plan_price AS CHAR), ', Provided: ', CAST(p_amount AS CHAR));
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = error_message;
    END IF;

    -- Insert payment details and activate the latest inactive subscription
    INSERT INTO Payment (payment_method, payment_date, amount, username, subscription_id)
    VALUES (p_payment_method, CURDATE(), p_amount, p_username, subscription_id);

    UPDATE UserSubscription 
    SET status = 'active' 
    WHERE subscription_id = subscription_id AND username = p_username; -- Added username in WHERE clause
END ;;
DELIMITER ;
