CREATE DEFINER=`root`@`localhost` PROCEDURE `RecordUserListen`(
    IN p_username VARCHAR(255), 
    IN p_track_id INT
)
BEGIN
    DECLARE v_exists INT;
    DECLARE v_play_count INT;
    DECLARE v_play_date DATE;
    
    SET v_play_date = CURDATE();

    -- Check if the user and track exist
    SELECT COUNT(*) INTO v_exists FROM User WHERE username = p_username;
    IF v_exists = 0 THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'User not found';
    END IF;

    SELECT COUNT(*) INTO v_exists FROM Track WHERE track_id = p_track_id;
    IF v_exists = 0 THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Track not found';
    END IF;

    -- Check if there's an existing record for this user and track for today
    SELECT play_count INTO v_play_count FROM UserListensToTrack
    WHERE username = p_username AND track_id = p_track_id AND play_date = v_play_date;

    IF v_play_count IS NOT NULL THEN
        -- Update existing record
        UPDATE UserListensToTrack
        SET play_count = v_play_count + 1
        WHERE username = p_username AND track_id = p_track_id AND play_date = v_play_date;
    ELSE
        -- Insert new record
        INSERT INTO UserListensToTrack (username, track_id, play_date, play_count)
        VALUES (p_username, p_track_id, v_play_date, 1);
    END IF;
END ;;
