CREATE DEFINER=`root`@`localhost` PROCEDURE `SearchArtistByName`(IN artist_name VARCHAR(255))
BEGIN
    DECLARE artist_exists INT;

    -- Check if the artist exists
    SELECT COUNT(*) INTO artist_exists FROM Artist WHERE name = artist_name;

    IF artist_exists = 0 THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Artist not found';
    ELSE
        -- Fetching albums by the artist
        SELECT 
            A.album_id, 
            A.name AS album_name, 
            A.release_date, 
            A.image AS album_image
        FROM 
            Album A
        WHERE 
            A.artist_name = artist_name;

        -- Fetching tracks by the artist
        SELECT 
            T.track_id, 
            T.name AS track_name, 
            T.duration, 
            T.file_path, 
            A.album_id, 
            A.name AS album_name
        FROM 
            Track T
        JOIN 
            Album A ON T.album_id = A.album_id
        WHERE 
            A.artist_name = artist_name;
    END IF;
END ;;
