CREATE DEFINER=`root`@`localhost` PROCEDURE `SubscribeToPlan`(
    IN p_username VARCHAR(255), 
    IN p_plan_name VARCHAR(255))
BEGIN
    DECLARE existing_plan_exists INT;

    -- Check if user exists
    IF NOT EXISTS (SELECT 1 FROM User WHERE username = p_username) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'User does not exist';
    END IF;

    -- Check if the plan exists
    IF NOT EXISTS (SELECT * FROM Plan WHERE name = p_plan_name) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Subscription plan does not exist';
    END IF;

    -- Check if the user already has a subscription record
    SELECT COUNT(*) INTO existing_plan_exists FROM UserSubscription WHERE username = p_username;

    IF existing_plan_exists > 0 THEN
        -- Update the existing subscription
        UPDATE UserSubscription
        SET plan_name = p_plan_name, 
            subscription_start = CURDATE(),
            status = IF(p_plan_name = 'basic', 'active', 'inactive') -- Set to 'active' for basic, 'inactive' otherwise
        WHERE username = p_username;
    ELSE
        -- Insert a new subscription record
        INSERT INTO UserSubscription (username, plan_name, subscription_start, status)
        VALUES (p_username, p_plan_name, CURDATE(), IF(p_plan_name = 'basic', 'active', 'inactive'));
    END IF;
END ;;
DELIMITER ;
