CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateAlbum`(
    IN p_album_id INT,
    IN p_new_name VARCHAR(255), 
    IN p_new_release_date DATE, 
    IN p_new_image VARCHAR(255),
    IN p_new_artist_name VARCHAR(255),
    IN p_admin_role ENUM('user', 'admin'),
    IN p_admin_token VARCHAR(255))
BEGIN
    IF p_admin_role != 'admin' OR p_admin_token != 'adminCRUD' THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Unauthorized access';
    END IF;

    IF NOT EXISTS (SELECT 1 FROM Album WHERE album_id = p_album_id) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Album not found';
    END IF;

    IF p_new_name IS NULL OR TRIM(p_new_name) = '' THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Missing new album name';
    END IF;

    IF NOT EXISTS (SELECT 1 FROM Artist WHERE name = p_new_artist_name) THEN
