CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateArtistSimilarityTrue`()
BEGIN
    DECLARE done INT DEFAULT FALSE;
    DECLARE artist1, artist2 VARCHAR(255);
    DECLARE overlap_count INT;
    DECLARE total_genres INT;
    DECLARE similarity_score DECIMAL(5, 4);
    DECLARE cur1 CURSOR FOR SELECT name FROM Artist;
    DECLARE cur2 CURSOR FOR SELECT name FROM Artist;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    OPEN cur1;

    read_loop: LOOP
        FETCH cur1 INTO artist1;
        IF done THEN
            LEAVE read_loop;
        END IF;

        SET done = FALSE; -- Reset the done flag
        OPEN cur2;

        inner_loop: LOOP
            FETCH cur2 INTO artist2;
            IF done THEN
                LEAVE inner_loop;
            END IF;

            IF artist1 != artist2 THEN
                -- Calculate genre overlap
                SELECT COUNT(*) INTO overlap_count
                FROM GenreCategorizesTrack 
                WHERE track_id IN (SELECT track_id FROM Track WHERE album_id IN (SELECT album_id FROM Album WHERE artist_name = artist1))
                AND genre_id IN (SELECT genre_id FROM GenreCategorizesTrack WHERE track_id IN (SELECT track_id FROM Track WHERE album_id IN (SELECT album_id FROM Album WHERE artist_name = artist2)));

                -- Calculate total distinct genres for both artists
                SELECT COUNT(DISTINCT genre_id) INTO total_genres
                FROM GenreCategorizesTrack 
                WHERE track_id IN (SELECT track_id FROM Track WHERE album_id IN (SELECT album_id FROM Album WHERE artist_name = artist1 OR artist_name = artist2));

                -- Calculate similarity score (simple ratio)
                IF total_genres > 0 THEN
                    SET similarity_score = overlap_count / total_genres;
                ELSE
                    SET similarity_score = 0;
                END IF;

                -- Insert or update the similarity score in ArtistSimilarity table
                INSERT INTO ArtistSimilarity (artist_name1, artist_name2, similarity_score)
                VALUES (artist1, artist2, similarity_score)
                ON DUPLICATE KEY UPDATE similarity_score = VALUES(similarity_score);
            END IF;
        END LOOP inner_loop;

        CLOSE cur2;
    END LOOP read_loop;

    CLOSE cur1;
END ;;
DELIMITER ;
