CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateTrackSimilarity`(IN batch_size INT)
BEGIN
    DECLARE done INT DEFAULT FALSE;
    DECLARE track1, track2 INT;
    DECLARE counter INT DEFAULT 0;
    DECLARE similarity_score DECIMAL(5, 4);
    DECLARE last_processed_id INT;
    DECLARE cur1 CURSOR FOR SELECT track_id FROM Track WHERE track_id > last_processed_id;
    DECLARE cur2 CURSOR FOR SELECT track_id FROM Track WHERE track_id > track1;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    -- Retrieve the last processed track ID
    SELECT IFNULL(MAX(last_processed_track_id), 0) INTO last_processed_id FROM TrackSimilarityProgress;

    OPEN cur1;

    read_loop: LOOP
        FETCH cur1 INTO track1;
        IF done OR counter >= batch_size THEN
            LEAVE read_loop;
        END IF;

        OPEN cur2;

        inner_loop: LOOP
            FETCH cur2 INTO track2;
            IF done THEN
                LEAVE inner_loop;
            END IF;

            -- Generate a random similarity score between 0 and 1
            SET similarity_score = RAND();

            -- Insert or update the similarity score in TrackSimilarity table
            INSERT INTO TrackSimilarity (track_id1, track_id2, similarity_score)
            VALUES (track1, track2, similarity_score)
            ON DUPLICATE KEY UPDATE similarity_score = VALUES(similarity_score);

            SET counter = counter + 1;
            IF counter >= batch_size THEN
                LEAVE inner_loop;
            END IF;
        END LOOP inner_loop;

        CLOSE cur2;

        -- Update the last processed track ID
        REPLACE INTO TrackSimilarityProgress (last_processed_track_id) VALUES (track1);
    END LOOP read_loop;

    CLOSE cur1;
END ;;
DELIMITER ;
