CREATE DEFINER=`root`@`localhost` PROCEDURE `UserLogin`(
    IN p_username VARCHAR(255), 
    IN p_password VARCHAR(255),
    OUT p_login_success BOOLEAN,
    OUT p_role ENUM('user', 'admin'))
BEGIN
    DECLARE db_password_hash VARCHAR(255);
    DECLARE db_user_role ENUM('user', 'admin');

    SET p_login_success = FALSE;

    -- Check for missing username or password
    IF p_username IS NULL OR p_username = '' THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Username is required';
    END IF;

    IF p_password IS NULL OR p_password = '' THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Password is required';
    END IF;

    -- Retrieve stored password hash and role
    SELECT password_hash, role INTO db_password_hash, db_user_role
    FROM User
    WHERE username = p_username;

    -- Check if username exists
    IF db_password_hash IS NULL THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Invalid username';
    ELSE
        -- Check password
        IF SHA2(CONCAT(p_password, 'salt'), 256) = db_password_hash THEN
            SET p_login_success = TRUE;
            SET p_role = db_user_role;
        ELSE
            SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Invalid password';
        END IF;
    END IF;
END ;;
DELIMITER ;
